import React, { useState } from 'react';
import {
  Container, Typography, TextField, Button, Grid, IconButton,
  Box, Paper
} from '@mui/material';
import { AddCircle, RemoveCircle } from '@mui/icons-material';

const CreateProjectPage = () => {
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [tripType, setTripType] = useState('');
  const [groupMembers, setGroupMembers] = useState([{ name: '', email: '' }]);

  const handleAddGroupMember = () => {
    setGroupMembers([...groupMembers, { name: '', email: '' }]);
  };

  const handleRemoveGroupMember = (index) => {
    const updatedMembers = [...groupMembers];
    updatedMembers.splice(index, 1);
    setGroupMembers(updatedMembers);
  };

  const handleGroupMemberChange = (index, field, value) => {
    const updatedMembers = [...groupMembers];
    updatedMembers[index][field] = value;
    setGroupMembers(updatedMembers);
  };

  const handleSaveProject = async () => {
    const customer_id = localStorage.getItem('customer_id');

    if (!customer_id) {
      alert('User not logged in. Please login first.');
      return;
    }

    try {
      const response = await fetch('http://localhost:5000/create-trip', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({
          customer_id,
          start_date: startDate,
          end_date: endDate,
          trip_type: tripType,
          group_members: groupMembers
        })
      });

      const data = await response.json();

      if (response.ok) {
        alert('Project saved successfully!');
        setStartDate('');
        setEndDate('');
        setTripType('');
        setGroupMembers([{ name: '', email: '' }]);
      } else {
        alert(`Error: ${data.error}`);
      }
    } catch (error) {
      console.error('Error saving project:', error);
      alert('Failed to save project');
    }
  };

  return (
    <Container maxWidth="md">
      <Paper elevation={3} sx={{ padding: 4, mt: 4 }}>
        <Typography variant="h4" gutterBottom>
          Create New Project
        </Typography>

        <TextField
          fullWidth
          label="Trip Type"
          value={tripType}
          onChange={(e) => setTripType(e.target.value)}
          sx={{ mb: 2 }}
        />
        <TextField
          fullWidth
          type="date"
          label="Start Date"
          value={startDate}
          onChange={(e) => setStartDate(e.target.value)}
          InputLabelProps={{ shrink: true }}
          sx={{ mb: 2 }}
        />
        <TextField
          fullWidth
          type="date"
          label="End Date"
          value={endDate}
          onChange={(e) => setEndDate(e.target.value)}
          InputLabelProps={{ shrink: true }}
          sx={{ mb: 2 }}
        />

        <Typography variant="h6" sx={{ mt: 3 }}>
          Group Members
        </Typography>

        {groupMembers.map((member, index) => (
          <Box key={index} display="flex" alignItems="center" sx={{ mb: 2 }}>
            <TextField
              label="Name"
              value={member.name}
              onChange={(e) => handleGroupMemberChange(index, 'name', e.target.value)}
              sx={{ mr: 2 }}
            />
            <TextField
              label="Email"
              value={member.email}
              onChange={(e) => handleGroupMemberChange(index, 'email', e.target.value)}
              sx={{ mr: 2 }}
            />
            <IconButton onClick={() => handleRemoveGroupMember(index)} color="error">
              <RemoveCircle />
            </IconButton>
          </Box>
        ))}

        <Button
          variant="outlined"
          startIcon={<AddCircle />}
          onClick={handleAddGroupMember}
          sx={{ mb: 3 }}
        >
          Add Member
        </Button>

        <Grid container justifyContent="flex-end">
          <Button variant="contained" color="primary" onClick={handleSaveProject}>
            Save Project
          </Button>
        </Grid>
      </Paper>
    </Container>
  );
};

export default CreateProjectPage;
